    false,nt"url": null,nt"notes": "This report summarizes a survey of the
    submergent and emergent aquatics growing in the marsh on the Canvasback Gun Club
    in Nevada. The marsh portion of the Canvasback Club is definitely of a mature nature.
    As long as present conditions exist it will remain that way. Right now the water
    in the Freeman Group, Mallard-Sens Group, and Dutch Bill Lakes is deep and turbid,
    allowing very little light penetration. Carp are abundant in all of these ponds
    and increase the turbidity even more. The emergent vegetation, hardstem bulrush
    and cattail, is growing well and leaving very little room for anything else.  The
    Arthur-Johnson group of ponds is the only part of the marsh that holds any food
    value for waterfowl. These ponds all have good growths of sago pondweed. They are
    fairly shallow, averaging 31 inches in depth. The water is clear and the bottom
    hard. No carp have been observed. All of these characters exemplify a good producing
    marsh pond.  If the recommendations that have already been made in past reports
    are followed, the rest of the marsh ponds could become good producers similar to
    the Arthur-Johnson group.",nt"license_title": "License Not Specified",nt"extras":
